class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m,n=len(board),len(board[0])
        res=[[] for _ in range(m)]
        for i in range(m):
            for j in range(n):
                res[i].append([-board[i][j],j])
                res[i].sort()
                if len(res[i])>3:
                    res[i].pop()
        res.sort(key=lambda x:(x[0][0],x[1][0],x[2][0]))
        ans=-inf
        for i in range(min(m,9)):
            for j in range(i+1,min(m,9)):
                for k in range(j+1,min(m,9)):
                    for a in range(3):
                        for b in range(3):
                            for c in range(3):
                                if res[i][a][1]!=res[j][b][1] and res[k][c][1]!=res[j][b][1] and res[i][a][1]!=res[k][c][1]:
                                    ans=max(ans,-res[i][a][0]-res[j][b][0]-res[k][c][0])
        return ans
